CREATE TABLE FUNCION
(
	ID NUMBER NOT NULL,
	NOMBRE VARCHAR(255),
	ID_ESPECTACULO NUMBER NOT NULL,
	DIA NUMBER NOT NULL,
	MES NUMBER NOT NULL,
	ANO NUMBER NOT NULL,
	HORA NUMBER NOT NULL,
	PRESENTADA NUMBER NOT NULL,
	CONSTRAINT FUNCION_PK PRIMARY KEY(ID),
	CONSTRAINT FK_ESPECTACULO
	FOREIGN KEY(ID_ESPECTACULO) REFERENCES ESPECTACULO(ID)
);


COMMIT;